import { useContext } from "react";
import SearchOptionUI from "../SearchOptionUI";
import CategoryContext from "../../../../../store/category/category--context";
import style from "./SearchOptionCategory.module.css";

const checkboxTime = [
  { text: "food", value: "food" },
  { text: "clothing", value: "clothing" },
  { text: "housing", value: "housing" },
  { text: "transportation", value: "transportation" },
  { text: "education", value: "education" },
  { text: "entertainment", value: "entertainment" },
  { text: "salary", value: "salary" },
  { text: "stock", value: "stock" },
];

function SearchOptionCategory() {
  return (
    <SearchOptionUI
      dataID="category"
      label="category"
      checkboxItem={checkboxTime}
    />
  );
}

export default SearchOptionCategory;
